def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    # handle case when key is a list
    if isinstance(key, list):
        keys = key
    else:
        keys = [key]

    groupings = []
    exclusions = []

    for i, key in enumerate(keys):
        if isinstance(key, Grouper):
            binner, grouper, obj = key._get_grouper(obj, validate=False)
            if key.key is None:
                return grouper, [], obj
            else:
                return grouper, {key.key}, obj

        elif isinstance(key, BaseGrouper):
            return key, [], obj

        else:
            if key not in obj.columns and key not in obj.index.names:
                raise KeyError(key)

            if is_categorical_dtype(obj[key]) and len(obj[key]) != obj.shape[axis]:
                raise ValueError(
                    f"Length of grouper ({len(obj[key])}) and axis ({obj.shape[axis]}) must be same length"
                )

            ping = Grouping(
                group_axis,
                obj[key],
                obj=obj,
                sort=sort,
                observed=observed,
            )

            groupings.append(ping)
            exclusions.append(key)

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)

    return grouper, exclusions, obj
